import React, {FC, useState} from 'react';
import SchoolIcon from '@mui/icons-material/School';
import BedIcon from '@mui/icons-material/Bed';

export enum Type {
    type_x = 'type_x',
    type_o = 'type_o',
    none = 'none'
}

export interface ToeProps {
    type: Type,
    win: boolean
}


//component
const Toe: FC<ToeProps> = ({type,win}) => {

    if (state.type === Type.none) return (
        <div style={{
            border: '4px solid #0288d1',
            borderRadius: '10px',
            display: 'flex',
            width: '90px',
            height: '90px',
            alignSelf: 'center',
            verticalAlign: 'baseline',
            flexFlow: 'row wrap',
            flexWrap: 'wrap'
        }}
             onClick={() => {
                 setState({type: onClick(), win: false})
             }}
        />
    );
    else if (state.type === Type.type_o) return (


        <BedIcon
            style={{
                border: '4px solid #0288d1',
                borderRadius: '10px',
                display: 'flex',
                width: '90px',
                height: '90px',
                alignSelf: 'center',
                verticalAlign: 'baseline',
                flexFlow: 'row wrap',
                flexWrap: 'wrap'
            }}
            color={'info'}
            fontSize={"large"}
            onClick={() => {
            }}
        />
    );


    else return (
            <SchoolIcon
                color={'info'}
                style={{
                    border: '4px solid #0288d1',
                    borderRadius: '10px',
                    display: 'flex',
                    width: '90px',
                    height: '90px',
                    alignSelf: 'center',
                    verticalAlign: 'baseline',
                    flexFlow: 'row wrap',
                    flexWrap: 'wrap'
                }}
                fontSize={"large"}
                onClick={() => {
                }}
            />

        );
};

export default Toe;
